・100Vコード式電動工具が充電式工具のように使えます！<br><br>
・『I-BOX ＋ 100V工具』   &nbsp;&nbsp;持ち運びに便利なコンパクトサイズ！<br>
&nbsp;&nbsp;※ご使用いただける工具は日立が指定した工具に限ります。<br><br>
・『I-BOX ＋ 芝刈機』   &nbsp;&nbsp;100VでもI-BOXでも使えて便利！<br><br>  

［充電時間］<br>
180分<br><br>

［入力電圧］<br>
DC14.4V<br><br>

［出力電圧］<br>
AC100V<br><br>

［最大出力］<br>
400W<br><br>

［質量］<br>
1.4kg（蓄電池含まず）<br><br>

